package com.example.fitnessproject.ui.activities.splash

import android.content.Intent
import android.util.Log
import com.example.fitnessproject.FitnessApplication
import com.example.fitnessproject.R
import com.example.fitnessproject.data.local.entity.User
import com.example.fitnessproject.domain.model.Gender
import com.example.fitnessproject.ui.BaseActivity
import com.example.fitnessproject.ui.activities.gender.ChooseGenderActivity
import kotlinx.android.synthetic.main.activity_splash.*
import kotlinx.coroutines.Dispatchers
import kotlinx.coroutines.GlobalScope
import kotlinx.coroutines.launch
import kotlinx.coroutines.withContext

class SplashActivity : BaseActivity<SplashViewModel>() {
    override fun getLayoutId() = R.layout.activity_splash
    override fun initScreen() {
        btnTest?.setOnClickListener {
            viewModel.getAllUser()

            startActivity(Intent(this, ChooseGenderActivity::class.java))
            finish()
        }

//        getUser1()
//        getUser2()

    }

    fun insertUser() {
        val user2 = User(
            name = "",
            password = "",
            gender = Gender.MALE.gender,
            height = 10.1,
            weight = 120.1
        )
        GlobalScope.launch(Dispatchers.Main) {
            withContext(Dispatchers.IO) {
                (application as FitnessApplication).repository.insertUser(user2)
                Log.e("TAG", "Insert success 33")
            }
            Log.e("TAG", "Insert success 34")
        }
    }

    override fun onResume() {
        super.onResume()
        viewModel.showLoading(false)
    }

}